import ProductComponent from "./components/products/ProductComponent";
import Navbar from "./components/Navbar";

function App() {

  const templete = {
    title: "Registration Form",
    fields: [
      {
        title: "First name",
        type: "text",
        name: "firstname",
        placeholder: "Enter your firstname",
      },
      {
        title: "Last name",
        type: "text",
        name: "lastname",
